  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Necedah
  National Wildlife Refuge outlines Refuge accomplishments during the 1991 calendar
  year. The report begins with a summary of the year's highlights and weather conditions.
  The report includes a planning section which discusses the master plan, management
  planning, public participation, compliance with environmental and cultural resource
  mandates, and research and investigations. Refuge administration is outlined; information
  about personnel, youth programs, other manpower programs, volunteer programs, funding,
  safety, and technical assistance is given. Habitat management is also covered; subjects
  include wetlands, forests, croplands, grasslands, haying, fire management, pest
  control, and wilderness and special areas. The wildlife section of the report discusses
  wildlife diversity, endangered and threatened species, waterfowl, marsh birds and
  waterbirds, shorebirds, raptors, other migratory birds, game mammals, fisheries
  resources, animal control, marking and bird banding, and disease control. The public
  uses of the Refuge described in this report include interpretive programs, hunting,
  fishing, trapping, wildlife observation, other wildlife oriented recreation, camping,
  picnicking, off-road vehicles, other non-wildlife oriented recreation, and law enforcement.
  The equipment and facilities section of the report provides information about rehabilitation,
  major maintenance, equipment utilization and replacement, communication systems,
  computer systems, and energy conservation. Refuge brochures and newspaper articles
  are attached.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
